function temperatureGraph(target,data){
	series1t = [];
	series2t = [];
	series3t = [];
	time = []
    for(var i=0; i<7000; i++){
	    series1t.push(Number(data[i]['Original Temperature']));
		series2t.push(Number(data[i]['Predicted Temperature']));
		series3t.push(Number(data[i]['Sensor Temperature']));
		time.push(data[i]['Time'].split(" ")[0]);
    }
	document.addEventListener('DOMContentLoaded', function () {
		var myChart = Highcharts.chart(target, {
			chart: {
				type: 'line'
			},
			title: {
				text: 'Temperature'
			},
			xAxis: {
				categories: time
			},
			yAxis: {
				title: {
					text: 'Temperature (Â°C)'
				}
			},
			plotOptions: {
				turboThreshold: 0
			},
			series: [{
				name: 'API',
				data: series1t
			}, {
				name: 'Predicted',
				data: series2t
			}, {
				name: 'Sensor',
				data: series3t
			}]
		});
	});
}

